import './App.css'
import Navbar from './components/Navbar'

const Home = () => {
  return (
    <div>
      Hello World. This is a Home Page
    </div>
  )
}

function App() {
  return (
    <div className="App">
      <Navbar />
      <Home />
    </div>
  );
}

export default App;
